    //           type="email"
    //           name="email"
    //           onChange={handleInputChange}
    //           placeholder="Email"/>
    //           <input
    //           type="password"
    //           name="password"
    //           onChange={handleInputChange}
    //           placeholder="Password"/>
    //           <div className="row2">
    //             <input type="submit" name="" value="Signup"  onClick={handleSubmit} href="#"></input>
    //             <a className="already text-muted" href="/">
    //               Already a user?
    //             </a>
    //           </div>
    //         </form>
    //       </div>
    //     </div>
    //   </div>
    // </div>
  );
}

export default CardSigup;
